webpackJsonp([0xc326ffa3e045],{4903:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Happy New Year 2014",date:"31 Dec 2013",slug:"/2013-12-31-happy-new-year-2014/",tags:"Y2013"},html:'<p>Happy New Year! Here\'s our son\'s latest film creation. It\'s not for the faint of heart.</p>\n<p><iframe width="450" height="253" src="//www.youtube-nocookie.com/embed/u39IyQpQIbI?rel=0" frameborder="0" allowfullscreen></iframe></p>'},next:{fields:{title:"Ikea Update",date:"02 Nov 2013",slug:"/2013-11-02-ikea-update/"}},previous:{fields:{title:"Five Pounds of Post",date:"03 Jan 2014",slug:"/2014-01-03-five-pounds-of-post/"}}},{node:{fields:{title:"Ikea Update",date:"02 Nov 2013",slug:"/2013-11-02-ikea-update/",tags:"Y2013"},html:'<p>For those following our <a href="http://www.papascott.de/archives/2013/10/26/ikea/" title="Ikea">Ikea saga</a>, we did manage to <a href="http://4sq.com/1aGOw8p" title="Ikea">make it to Ikea</a> a couple of days ago. In case it wasn\'t clear from the original post, my main objection to the first trip was that it was on a Saturday when the roads and the store would be completely full. My wife is redesigning our bathroom, and it was important to her that she show me the items in person at the store so I would feel involved in the decision.</p>\n<p>However, our purchasing using the self-service registers was an utter failure. Of our 14 items, we managed to leave 2 items unscanned at the table. I swear I spent and hour looking for our new blinds until I realized that they weren\'t on our receipt and they never made it out of the store.</p>'},next:{fields:{title:"Ikea",date:"26 Oct 2013",slug:"/2013-10-26-ikea/"}},previous:{fields:{title:"Happy New Year 2014",date:"31 Dec 2013",slug:"/2013-12-31-happy-new-year-2014/"}}},{node:{fields:{title:"Ikea",date:"26 Oct 2013",slug:"/2013-10-26-ikea/",tags:"Y2013"},html:'<p><a href="http://www.papascott.de/wordpress/wp-content/uploads/2013/10/IKEA-logo.jpg"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2013/10/IKEA-logo-300x190.jpg" alt="IKEA-logo" width="300" height="190" class="alignright size-medium wp-image-17117" /></a>Should I be worried when, we have a free weekend alone without our son, that my wife\'s best suggestion for an activity together is a trip to Ikea?</p>\n<p>Should I be even more worried when, after I express my doubts about going to Ikea, the next day she changes her mind and says I don\'t need to come along after all?</p>'},next:{fields:{title:"Oslo Cruise Again",date:"09 Sep 2013",slug:"/2013-09-09-oslo-cruise-again/"}},previous:{fields:{title:"Ikea Update",date:"02 Nov 2013",slug:"/2013-11-02-ikea-update/"}}}],pathPrefix:"",first:!1,last:!1,index:15,pageCount:1101}}}});
